// ==UserScript==
// @name         BGA Skat 4 colors
// @version      0.2
// @description  BGAのスカートを4色トランプでプレイできるようにします
// @match        https://boardgamearena.com/*/skat?*
// @icon         data:image/gif;base64,R0lGODlhAQABAAAAACH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==
// @grant        none
// @namespace https://greasyfork.org/users/774206
// @downloadURL https://update.greasyfork.org/scripts/426762/BGA%20Skat%204%20colors.user.js
// @updateURL https://update.greasyfork.org/scripts/426762/BGA%20Skat%204%20colors.meta.js
// ==/UserScript==

(function() {
    'use strict';

    console.log("Loading BGA Skat 4 colors...");

    const css = `
.cardontable.french,
.stockitem.myStockitem,
.playertablecard.lasttrick.french
{
    background-image: url("data:image/png;base64,") !important;
}
`;

    if (typeof GM_addStyle != "undefined") {
        console.log("applying css by GM_addStyle");
        GM_addStyle(css);
    } else if (typeof PRO_addStyle != "undefined") {
        console.log("applying css by PRO_addStyle");
        PRO_addStyle(css);
    } else if (typeof addStyle != "undefined") {
        console.log("applying css by addStyle");
        addStyle(css);
    } else {
        console.log("applying css by <style>");
        var node = document.createElement("style");
        node.type = "text/css";
        node.appendChild(document.createTextNode(css));
        var heads = document.getElementsByTagName("head");
        if (heads.length > 0) {
            heads[0].appendChild(node);
        } else {
            // no head yet, stick it whereever
            document.documentElement.appendChild(node);
        }
    }
})();